import React from 'react';

export default function Consulting() {
  return (
    <>
      <h1 className='consulting'>CONSULTING</h1>
      <h1> Melayani Berbagai Macam Konsultasi</h1>
      <h1> Konsultasi Pra-Nikah</h1>
      <h1> Konsultasi Psikology</h1>
      <h1> Konsultasi Hubungan Rumah Tangga</h1>
      <h1> Konsultasi Psikotest</h1>
    </>
  );
}
